import React from "react";

function Resume() {
    return (

        <section id="resume">
        <h2>Resume</h2>
        <div className="resumeStyle">
          <h4 class="repository" onclick="openResume()">View Resume</h4>
          <h4><a href="./assets/images/ResumeThang.pdf" target="_blank">Download Resume</a></h4>
          <p id="resumePreview" style="display: none">
            <img src="./assets/images/ResumeThang.png" alt="resume"></img> </p>
        </div>

      </section>
    );
}

export default Resume;
